text:
als außenstehender kann ich nur sagen, dass radikale fußballfans sich viel zu oft wie dämliche kinder verhalten und diesen bullshit viel zu ernst nehmen. es ist ein verficktes spiel. dies. viel zu viele menschen werden über das hoch-kommerzielle hin-und-her-schieben eines balles viel zu emotional. fußball ist ein riesen unterhaltungs-geschäft, das ganze dann schön mit ausgelebter maskulinität und alkoholkonsum gekoppelt. es wird doch schon seit jahrzehnten jeder zweite als hurensohn, fotze oder anderes sexistisches schimpfwort beleidigt; weil es jetzt gegen einen milliardär geht ist es schlimm? wo ist der unterschied zwischen dem sponsor hoffenheims und anderen vereinen? wird bayern münchen nicht genauso mit geldern vollgepumpt, oder kaufen die ihre spieler für hunderte millionen aus pfandflaschensammeln?
x200b;
die ganze szenerie ist genauso abstrus wie die hier in frankfurt gerade populären demos gegen montagsspiele, während die selben fans für europacup-spiele mitten in der woche halb europa bereisen.

eines von vielen beispielen warum wir keine koalition sondern eine alleinregierung haben.
x200b;
und gleich kommen sie wieder die mimimimimi lieber grün als blau prediger. du tust so, als wäre die sache so klar gewesen. das war sie nicht. es hätte genauso gut auch zugunsten der regierung ausgehen können. man hätte bestimmt gar nicht erst eine klage erhoben, wenn das rechtsgutachten, das vorher eingeholt wurden, nicht chancen eingeräumt hätte. auch oppositionsparteien haben sich an gesetze zu halten, und es kann nicht schaden, das ab und zu mal auf die probe zu stellen, wenn der verdacht besteht. jetzt haben sie ja gewonnen, und damit kann es weiter gehen.

mir soll mal ein infektiologe erklären, was unis so besonders macht gegenüber großraumbüros. wenn man keine 600 personen inkubatoren haben möchte, dann streicht halt alle massenstudien lvas. aber ob ich jetzt zu 20igst in einem kleinen hörsaal sitze, oder im büro ist sowas von egal. 
x200b;
nicht, dass ich gegen die maßnahme wäre. es ist nur unlogisch an nur einer front zu kämpfen. das messer im rücken werden wir eh bald spüren. in zwei wochen werden dann auch die kindergärten und schulen nachziehen. insbrucktirol dürfte irgendwie ein infektionsherd sein. zumindest lt. zib2 grad.

investieren, doch angesichts der multiplen krisen die mittlerweile so ziemlich die ganze menschheit erfasst haben, haben wir beschlossen nicht nur einige wenige verleger noch fetter zu machen, denn die fetten jahre sind vorbei 
..gerade wir als vergnügungsbranche dürfen auch nicht wirklich auf staatliche hilfen hoffen, denn obwohl wir definitiv system relevant im positiven sinne sind, wird's wenig vom staat als unterstützung geben..

